-- Name: grouper_memberships_all_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_memberships_all_v AS
 SELECT (((ms.id)::text || ':'::text) || (gs.id)::text) AS membership_id,
    ms.id AS immediate_membership_id,
    gs.id AS group_set_id,
    ms.member_id,
    gs.field_id,
    ms.field_id AS immediate_field_id,
    gs.owner_id,
    gs.owner_attr_def_id,
    gs.owner_group_id,
    gs.owner_stem_id,
    gs.via_group_id,
    ms.via_composite_id,
    gs.depth,
    gs.mship_type,
    ms.enabled AS immediate_mship_enabled,
    ms.enabled_timestamp AS immediate_mship_enabled_time,
    ms.disabled_timestamp AS immediate_mship_disabled_time,
    gs.parent_id AS group_set_parent_id,
    ms.creator_id AS membership_creator_id,
    ms.create_time AS membership_create_time,
    gs.creator_id AS group_set_creator_id,
    gs.create_time AS group_set_create_time,
    ms.hibernate_version_number,
    ms.context_id
   FROM public.grouper_memberships ms,
    public.grouper_group_set gs
  WHERE (((ms.owner_id)::text = (gs.member_id)::text) AND ((ms.field_id)::text = (gs.member_field_id)::text));


