-- Name: grouper_attr_asn_efmship_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_attr_asn_efmship_v AS
 SELECT DISTINCT gg.name AS group_name,
    gm.subject_source AS subject_source_id,
    gm.subject_id,
    gaaa.name AS action,
    gadn.name AS attribute_def_name_name,
    gg.display_name AS group_display_name,
    gadn.display_name AS attribute_def_name_disp_name,
    gad.name AS name_of_attribute_def,
    gaa.notes AS attribute_assign_notes,
    gf.name AS list_name,
    gaa.attribute_assign_delegatable,
    gaa.enabled,
    gaa.enabled_time,
    gaa.disabled_time,
    gg.id AS group_id,
    gaa.id AS attribute_assign_id,
    gadn.id AS attribute_def_name_id,
    gad.id AS attribute_def_id,
    gm.id AS member_id,
    gaaa.id AS action_id
   FROM public.grouper_attribute_assign gaa,
    public.grouper_memberships_all_v gmav,
    public.grouper_attribute_def_name gadn,
    public.grouper_attribute_def gad,
    public.grouper_groups gg,
    public.grouper_fields gf,
    public.grouper_members gm,
    public.grouper_attr_assign_action gaaa
  WHERE (((gaa.owner_group_id)::text = (gmav.owner_group_id)::text) AND ((gaa.owner_member_id)::text = (gmav.member_id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gadn.attribute_def_id)::text = (gad.id)::text) AND ((gmav.immediate_mship_enabled)::text = 'T'::text) AND ((gmav.owner_group_id)::text = (gg.id)::text) AND ((gmav.field_id)::text = (gf.id)::text) AND ((gf.type)::text = 'list'::text) AND ((gmav.member_id)::text = (gm.id)::text) AND (gaa.owner_member_id IS NOT NULL) AND (gaa.owner_group_id IS NOT NULL) AND ((gaa.attribute_assign_action_id)::text = (gaaa.id)::text));


