--

CREATE VIEW public.grouper_attr_def_priv_v AS
 SELECT DISTINCT gm.subject_id,
    gm.subject_source AS subject_source_id,
    gf.name AS field_name,
    gad.name AS attribute_def_name,
    gad.description AS attribute_def_description,
    gad.attribute_def_type,
    gad.stem_id AS attribute_def_stem_id,
    gad.id AS attribute_def_id,
    gm.id AS member_id,
    gmav.field_id,
    gmav.immediate_membership_id,
    gmav.membership_id
   FROM public.grouper_memberships_all_v gmav,
    public.grouper_attribute_def gad,
    public.grouper_fields gf,
    public.grouper_members gm
  WHERE (((gmav.owner_attr_def_id)::text = (gad.id)::text) AND ((gmav.field_id)::text = (gf.id)::text) AND ((gmav.immediate_mship_enabled)::text = 'T'::text) AND ((gmav.member_id)::text = (gm.id)::text));


