--
-- Name: grouper_aval_asn_asn_attrdef_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_aval_asn_asn_attrdef_v AS
 SELECT gad.name AS name_of_attr_def_assigned_to,
    gaaa1.name AS action1,
    gaaa2.name AS action2,
    gadn1.name AS attribute_def_name_name1,
    gadn2.name AS attribute_def_name_name2,
    gaav.value_string,
    gaav.value_integer,
    gaav.value_floating,
    gaav.value_member_id,
    gadn1.display_name AS attribute_def_name_disp_name1,
    gadn2.display_name AS attribute_def_name_disp_name2,
    gad1.name AS name_of_attribute_def1,
    gad2.name AS name_of_attribute_def2,
    gaa1.notes AS attribute_assign_notes1,
    gaa2.notes AS attribute_assign_notes2,
    gaa2.enabled AS enabled2,
    gaa2.enabled_time AS enabled_time2,
    gaa2.disabled_time AS disabled_time2,
    gad.id AS id_of_attr_def_assigned_to,
    gaa1.id AS attribute_assign_id1,
    gaa2.id AS attribute_assign_id2,
    gadn1.id AS attribute_def_name_id1,
    gadn2.id AS attribute_def_name_id2,
    gad1.id AS attribute_def_id1,
    gad2.id AS attribute_def_id2,
    gaaa1.id AS action_id1,
    gaaa2.id AS action_id2,
    gaav.id AS attribute_assign_value_id
   FROM public.grouper_attribute_assign gaa1,
    public.grouper_attribute_assign gaa2,
    public.grouper_attribute_def gad,
    public.grouper_attribute_def_name gadn1,
    public.grouper_attribute_def_name gadn2,
    public.grouper_attribute_def gad1,
    public.grouper_attribute_def gad2,
    public.grouper_attr_assign_action gaaa1,
    public.grouper_attr_assign_action gaaa2,
    public.grouper_attribute_assign_value gaav
  WHERE (((gaav.attribute_assign_id)::text = (gaa2.id)::text) AND ((gaa1.id)::text = (gaa2.owner_attribute_assign_id)::text) AND ((gaa1.attribute_def_name_id)::text = (gadn1.id)::text) AND ((gaa2.attribute_def_name_id)::text = (gadn2.id)::text) AND ((gadn1.attribute_def_id)::text = (gad1.id)::text) AND ((gadn2.attribute_def_id)::text = (gad2.id)::text) AND ((gaa1.enabled)::text = 'T'::text) AND ((gad.id)::text = (gaa1.owner_attribute_def_id)::text) AND ((gaa1.attribute_assign_action_id)::text = (gaaa1.id)::text) AND ((gaa2.attribute_assign_action_id)::text = (gaaa2.id)::text));


