    public.grouper_attr_assign_action gaaa1,
    public.grouper_attr_assign_action gaaa2,
    public.grouper_attribute_assign_value gaav
  WHERE (((gaav.attribute_assign_id)::text = (gaa2.id)::text) AND ((gaa1.owner_member_id)::text = (gmav.member_id)::text) AND ((gaa1.owner_group_id)::text = (gmav.owner_group_id)::text) AND ((gaa2.owner_attribute_assign_id)::text = (gaa1.id)::text) AND ((gaa1.attribute_def_name_id)::text = (gadn1.id)::text) AND ((gaa2.attribute_def_name_id)::text = (gadn2.id)::text) AND ((gadn1.attribute_def_id)::text = (gad1.id)::text) AND ((gadn2.attribute_def_id)::text = (gad2.id)::text) AND ((gaa1.enabled)::text = 'T'::text) AND ((gmav.immediate_mship_enabled)::text = 'T'::text) AND ((gmav.field_id)::text = (gf.id)::text) AND ((gmav.member_id)::text = (gm.id)::text) AND ((gmav.owner_group_id)::text = (gg.id)::text) AND ((gf.type)::text = 'list'::text) AND (gaa1.owner_member_id IS NOT NULL) AND (gaa1.owner_group_id IS NOT NULL) AND ((gaa1.attribute_assign_action_id)::text = (gaaa1.id)::text) AND ((gaa2.attribute_assign_action_id)::text = (gaaa2.id)::text));


