CREATE VIEW public.grouper_aval_asn_attrdef_v AS
 SELECT gad_assigned_to.name AS name_of_attr_def_assigned_to,
    gaaa.name AS action,
    gadn.name AS attribute_def_name_name,
    gaav.value_string,
    gaav.value_integer,
    gaav.value_floating,
    gaav.value_member_id,
    gadn.display_name AS attribute_def_name_disp_name,
    gad.name AS name_of_attribute_def_assigned,
