    gaa.enabled,
    gaa.enabled_time,
    gaa.disabled_time,
    gad_assigned_to.id AS id_of_attr_def_assigned_to,
    gaa.id AS attribute_assign_id,
    gadn.id AS attribute_def_name_id,
    gad.id AS attribute_def_id,
    gaaa.id AS action_id,
    gaav.id AS attribute_assign_value_id
   FROM public.grouper_attribute_assign gaa,
    public.grouper_attribute_def gad_assigned_to,
    public.grouper_attribute_def_name gadn,
    public.grouper_attribute_def gad,
    public.grouper_attr_assign_action gaaa,
    public.grouper_attribute_assign_value gaav
  WHERE (((gaav.attribute_assign_id)::text = (gaa.id)::text) AND ((gaa.owner_attribute_def_id)::text = (gad_assigned_to.id)::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gadn.attribute_def_id)::text = (gad.id)::text) AND ((gaa.attribute_assign_action_id)::text = (gaaa.id)::text));


