CREATE VIEW public.grouper_change_log_entry_v AS
 SELECT gcle.created_on,
    gclt.change_log_category,
    gclt.action_name,
    gcle.sequence_number,
    gclt.label_string01,
    gcle.string01,
    gclt.label_string02,
    gcle.string02,
    gclt.label_string03,
    gcle.string03,
    gclt.label_string04,
    gcle.string04,
    gclt.label_string05,
    gcle.string05,
    gclt.label_string06,
    gcle.string06,
    gclt.label_string07,
    gcle.string07,
    gclt.label_string08,
    gcle.string08,
    gclt.label_string09,
    gcle.string09,
    gclt.label_string10,
    gcle.string10,
    gclt.label_string11,
    gcle.string11,
    gclt.label_string12,
    gcle.string12,
    gcle.context_id,
    gcle.change_log_type_id
   FROM public.grouper_change_log_type gclt,
    public.grouper_change_log_entry gcle
  WHERE ((gclt.id)::text = (gcle.change_log_type_id)::text);


