--
-- Name: grouper_ext_subj_invite_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_ext_subj_invite_v AS
 SELECT ( SELECT gaav.value_string
           FROM public.grouper_attr_asn_asn_stem_v gaaasv,
            public.grouper_attribute_assign_value gaav
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteUuid'::text) AND ((gaav.attribute_assign_id)::text = (gaaasv.attribute_assign_id2)::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS invite_id,
    ( SELECT gaav.value_string
           FROM public.grouper_attr_asn_asn_stem_v gaaasv,
            public.grouper_attribute_assign_value gaav
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteMemberId'::text) AND ((gaav.attribute_assign_id)::text = (gaaasv.attribute_assign_id2)::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS invite_member_id,
    ( SELECT gaav.value_string
           FROM public.grouper_attr_asn_asn_stem_v gaaasv,
            public.grouper_attribute_assign_value gaav
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteDate'::text) AND ((gaav.attribute_assign_id)::text = (gaaasv.attribute_assign_id2)::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS invite_date,
    ( SELECT gaav.value_string
           FROM public.grouper_attr_asn_asn_stem_v gaaasv,
            public.grouper_attribute_assign_value gaav
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectEmailAddress'::text) AND ((gaav.attribute_assign_id)::text = (gaaasv.attribute_assign_id2)::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS email_address,
    ( SELECT gaav.value_string
           FROM public.grouper_attr_asn_asn_stem_v gaaasv,
            public.grouper_attribute_assign_value gaav
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteEmailWhenRegistered'::text) AND ((gaav.attribute_assign_id)::text = (gaaasv.attribute_assign_id2)::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS invite_email_when_registered,
    ( SELECT gaav.value_string
           FROM public.grouper_attr_asn_asn_stem_v gaaasv,
            public.grouper_attribute_assign_value gaav
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteGroupUuids'::text) AND ((gaav.attribute_assign_id)::text = (gaaasv.attribute_assign_id2)::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS invite_group_uuids,
    ( SELECT gaav.value_string
           FROM public.grouper_attr_asn_asn_stem_v gaaasv,
            public.grouper_attribute_assign_value gaav
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteExpireDate'::text) AND ((gaav.attribute_assign_id)::text = (gaaasv.attribute_assign_id2)::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS invite_expire_date,
    ( SELECT gaav.value_string
           FROM public.grouper_attr_asn_asn_stem_v gaaasv,
            public.grouper_attribute_assign_value gaav
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteEmail'::text) AND ((gaav.attribute_assign_id)::text = (gaaasv.attribute_assign_id2)::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS email_body,
    ( SELECT gaaasv.disabled_time2
           FROM public.grouper_attr_asn_asn_stem_v gaaasv
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteExpireDate'::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS expire_attr_expire_date,
    ( SELECT gaaasv.enabled2
           FROM public.grouper_attr_asn_asn_stem_v gaaasv
          WHERE (((gaaasv.attribute_def_name_name2)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInviteExpireDate'::text) AND ((gaaasv.attribute_assign_id1)::text = (gaasv.attribute_assign_id)::text))) AS expire_attr_enabled,
    gaasv.disabled_time AS assignment_expire_date,
    gaasv.enabled AS assignment_enabled,
    gaasv.attribute_assign_id
   FROM public.grouper_attr_asn_stem_v gaasv
  WHERE (((gaasv.attribute_def_name_name)::text = 'etc:attribute:attrExternalSubjectInvite:externalSubjectInvite'::text) AND ((gaasv.enabled)::text = 'T'::text));


