CREATE VIEW public.grouper_memberships_lw_v AS
 SELECT DISTINCT gm.subject_id,
    gm.subject_source,
    gg.name AS group_name,
    gfl.name AS list_name,
    gfl.type AS list_type,
    gg.id AS group_id,
    gm.id AS member_id
   FROM public.grouper_memberships_all_v gms,
    public.grouper_members gm,
    public.grouper_groups gg,
    public.grouper_fields gfl
  WHERE (((gms.owner_group_id)::text = (gg.id)::text) AND ((gms.field_id)::text = (gfl.id)::text) AND ((gms.member_id)::text = (gm.id)::text) AND ((gms.immediate_mship_enabled)::text = 'T'::text));


