--
-- Name: grouper_memberships_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_memberships_v AS
 SELECT ( SELECT gg.name
           FROM public.grouper_groups gg
          WHERE ((gg.id)::text = (gms.owner_group_id)::text)) AS group_name,
    ( SELECT gg.display_name
           FROM public.grouper_groups gg
          WHERE ((gg.id)::text = (gms.owner_group_id)::text)) AS group_displayname,
    ( SELECT gs.name
           FROM public.grouper_stems gs
          WHERE ((gs.id)::text = (gms.owner_stem_id)::text)) AS stem_name,
    ( SELECT gs.display_name
           FROM public.grouper_stems gs
          WHERE ((gs.id)::text = (gms.owner_stem_id)::text)) AS stem_displayname,
    gm.subject_id,
    gm.subject_source,
    gms.member_id,
    gf.type AS list_type,
    gf.name AS list_name,
    gms.mship_type AS membership_type,
    ( SELECT gg.name
           FROM public.grouper_groups gg,
            public.grouper_composites gc
          WHERE (((gg.id)::text = (gms.via_composite_id)::text) AND ((gg.id)::text = (gc.owner)::text))) AS composite_parent_group_name,
    gms.depth,
    ( SELECT gm_1.subject_source
           FROM public.grouper_members gm_1
          WHERE ((gm_1.id)::text = (gms.membership_creator_id)::text)) AS creator_source,
    ( SELECT gm_1.subject_id
           FROM public.grouper_members gm_1
          WHERE ((gm_1.id)::text = (gms.membership_creator_id)::text)) AS creator_subject_id,
    gms.membership_id,
    gms.immediate_membership_id,
    gms.group_set_id,
    ( SELECT gs.id
           FROM public.grouper_stems gs
          WHERE ((gs.id)::text = (gms.owner_stem_id)::text)) AS stem_id,
    ( SELECT gg.id
           FROM public.grouper_groups gg
          WHERE ((gg.id)::text = (gms.owner_group_id)::text)) AS group_id,
