--

CREATE VIEW public.grouper_perms_assigned_role_v AS
 SELECT DISTINCT gr.name AS role_name,
    gaaa.name AS action,
    gadn.name AS attribute_def_name_name,
    gadn.display_name AS attribute_def_name_disp_name,
    gr.display_name AS role_display_name,
    gaa.attribute_assign_delegatable,
    gaa.enabled,
    gaa.enabled_time,
    gaa.disabled_time,
    gr.id AS role_id,
    gadn.attribute_def_id,
    gadn.id AS attribute_def_name_id,
    gaaa.id AS action_id,
    grs.depth AS role_set_depth,
    gadns.depth AS attr_def_name_set_depth,
    gaaas.depth AS attr_assign_action_set_depth,
    gaa.id AS attribute_assign_id,
    gaa.notes AS assignment_notes,
    gaa.disallowed,
    'role'::text AS permission_type
   FROM public.grouper_groups gr,
    public.grouper_role_set grs,
    public.grouper_attribute_def gad,
    public.grouper_attribute_assign gaa,
    public.grouper_attribute_def_name gadn,
    public.grouper_attribute_def_name_set gadns,
    public.grouper_attr_assign_action gaaa,
    public.grouper_attr_assign_action_set gaaas
  WHERE (((grs.if_has_role_id)::text = (gr.id)::text) AND ((gr.type_of_group)::text = 'role'::text) AND ((gadn.attribute_def_id)::text = (gad.id)::text) AND ((gad.attribute_def_type)::text = 'perm'::text) AND ((gaa.owner_group_id)::text = (grs.then_has_role_id)::text) AND ((gaa.attribute_def_name_id)::text = (gadns.if_has_attribute_def_name_id)::text) AND ((gadn.id)::text = (gadns.then_has_attribute_def_name_id)::text) AND ((gaa.attribute_assign_type)::text = 'group'::text) AND ((gaa.attribute_assign_action_id)::text = (gaaas.if_has_attr_assn_action_id)::text) AND ((gaaa.id)::text = (gaaas.then_has_attr_assn_action_id)::text));


