-- Name: grouper_pit_memberships_all_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_pit_memberships_all_v AS
 SELECT (((ms.id)::text || ':'::text) || (gs.id)::text) AS id,
    ms.id AS membership_id,
    ms.source_id AS membership_source_id,
    gs.id AS group_set_id,
    ms.member_id,
    gs.field_id,
    ms.field_id AS membership_field_id,
    gs.owner_id,
    gs.owner_attr_def_id,
    gs.owner_group_id,
    gs.owner_stem_id,
    gs.active AS group_set_active,
    gs.start_time AS group_set_start_time,
    gs.end_time AS group_set_end_time,
    ms.active AS membership_active,
    ms.start_time AS membership_start_time,
    ms.end_time AS membership_end_time,
    gs.depth,
    gs.parent_id AS group_set_parent_id
   FROM public.grouper_pit_memberships ms,
    public.grouper_pit_group_set gs
  WHERE (((ms.owner_id)::text = (gs.member_id)::text) AND ((ms.field_id)::text = (gs.member_field_id)::text));


