CREATE VIEW public.grouper_pit_perms_role_v AS
 SELECT DISTINCT gr.name AS role_name,
    gm.subject_source AS subject_source_id,
    gm.subject_id,
    gaaa.name AS action,
    gadn.name AS attribute_def_name_name,
    gr.id AS role_id,
    gadn.attribute_def_id,
    gm.id AS member_id,
    gadn.id AS attribute_def_name_id,
    gaaa.id AS action_id,
    gmav.depth AS membership_depth,
    grs.depth AS role_set_depth,
    gadns.depth AS attr_def_name_set_depth,
    gaaas.depth AS attr_assign_action_set_depth,
    gmav.membership_id,
    gmav.group_set_id,
    grs.id AS role_set_id,
    gadns.id AS attribute_def_name_set_id,
    gaaas.id AS action_set_id,
    gaa.id AS attribute_assign_id,
    'role'::text AS permission_type,
    gmav.group_set_active,
    gmav.group_set_start_time,
    gmav.group_set_end_time,
    gmav.membership_active,
    gmav.membership_start_time,
    gmav.membership_end_time,
    grs.active AS role_set_active,
    grs.start_time AS role_set_start_time,
    grs.end_time AS role_set_end_time,
    gaaas.active AS action_set_active,
    gaaas.start_time AS action_set_start_time,
    gaaas.end_time AS action_set_end_time,
    gadns.active AS attr_def_name_set_active,
    gadns.start_time AS attr_def_name_set_start_time,
    gadns.end_time AS attr_def_name_set_end_time,
    gaa.active AS attribute_assign_active,
    gaa.start_time AS attribute_assign_start_time,
    gaa.end_time AS attribute_assign_end_time,
    gaa.disallowed,
    gaaa.source_id AS action_source_id,
    gr.source_id AS role_source_id,
    gadn.source_id AS attribute_def_name_source_id,
    gad.source_id AS attribute_def_source_id,
    gm.source_id AS member_source_id,
    gmav.membership_source_id,
    gaa.source_id AS attribute_assign_source_id
   FROM public.grouper_pit_groups gr,
    public.grouper_pit_memberships_all_v gmav,
    public.grouper_pit_members gm,
    public.grouper_pit_fields gf,
    public.grouper_pit_role_set grs,
    public.grouper_pit_attribute_def gad,
    public.grouper_pit_attribute_assign gaa,
    public.grouper_pit_attr_def_name gadn,
    public.grouper_pit_attr_def_name_set gadns,
    public.grouper_pit_attr_assn_actn gaaa,
    public.grouper_pit_attr_assn_actn_set gaaas
  WHERE (((gmav.owner_group_id)::text = (gr.id)::text) AND ((gmav.field_id)::text = (gf.id)::text) AND ((gf.type)::text = 'list'::text) AND ((gf.name)::text = 'members'::text) AND ((gmav.member_id)::text = (gm.id)::text) AND ((grs.if_has_role_id)::text = (gr.id)::text) AND ((gadn.attribute_def_id)::text = (gad.id)::text) AND ((gad.attribute_def_type)::text = 'perm'::text) AND ((gaa.owner_group_id)::text = (grs.then_has_role_id)::text) AND ((gaa.attribute_def_name_id)::text = (gadns.if_has_attribute_def_name_id)::text) AND ((gadn.id)::text = (gadns.then_has_attribute_def_name_id)::text) AND ((gaa.attribute_assign_type)::text = 'group'::text) AND ((gaa.attribute_assign_action_id)::text = (gaaas.if_has_attr_assn_action_id)::text) AND ((gaaa.id)::text = (gaaas.then_has_attr_assn_action_id)::text));


