          WHERE ((gms.owner_group_id)::text = (gg.id)::text)) AS membership_count,
    ( SELECT count(*) AS count
           FROM public.grouper_composites gc
          WHERE (((gc.left_factor)::text = (gg.id)::text) OR ((gc.right_factor)::text = (gg.id)::text))) AS isa_composite_factor_count,
    ( SELECT count(DISTINCT gms.owner_group_id) AS count
           FROM public.grouper_memberships_all_v gms,
            public.grouper_members gm
