-- Name: grouper_rpt_stems_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_rpt_stems_v AS
 SELECT gs.name AS stem_name,
    gs.display_name AS stem_displayname,
    ( SELECT count(*) AS count
           FROM public.grouper_groups gg
          WHERE ((gg.parent_stem)::text = (gs.id)::text)) AS group_immediate_count,
    ( SELECT count(*) AS count
           FROM public.grouper_stems gs2
          WHERE ((gs.id)::text = (gs2.parent_stem)::text)) AS stem_immediate_count,
    ( SELECT count(*) AS count
           FROM public.grouper_groups gg
          WHERE ((gg.name)::text ~~ ((gs.name)::text || '%'::text))) AS group_count,
    ( SELECT count(*) AS count
           FROM public.grouper_stems gs2
          WHERE ((gs2.name)::text ~~ ((gs.name)::text || '%'::text))) AS stem_count,
    ( SELECT count(DISTINCT gm.member_id) AS count
           FROM public.grouper_memberships_all_v gm
          WHERE ((gm.owner_stem_id)::text = (gs.id)::text)) AS this_stem_membership_count,
    ( SELECT count(DISTINCT gm.member_id) AS count
           FROM public.grouper_memberships_all_v gm,
            public.grouper_groups gg
          WHERE (((gg.parent_stem)::text = (gs.id)::text) AND ((gm.owner_stem_id)::text = (gg.id)::text))) AS child_group_membership_count,
    ( SELECT count(DISTINCT gm.member_id) AS count
           FROM public.grouper_memberships_all_v gm,
            public.grouper_groups gg
          WHERE (((gm.owner_group_id)::text = (gg.id)::text) AND ((gg.name)::text ~~ ((gs.name)::text || '%'::text)))) AS group_membership_count,
    gs.id AS stem_id
   FROM public.grouper_stems gs;


