--
-- Name: grouper_service_role_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_service_role_v AS
 SELECT DISTINCT
        CASE gf.name
            WHEN 'admins'::text THEN 'admin'::text
            WHEN 'updaters'::text THEN 'admin'::text
            WHEN 'members'::text THEN 'user'::text
            ELSE NULL::text
        END AS service_role,
    gg.name AS group_name,
    gadn.name AS name_of_service_def_name,
    gm.subject_source AS subject_source_id,
    gm.subject_id,
    gf.name AS field_name,
    gad.name AS name_of_service_def,
    gg.display_name AS group_display_name,
    gg.id AS group_id,
    gad.id AS service_def_id,
    gadn.id AS service_name_id,
    gm.id AS member_id,
    gf.id AS field_id,
    gadn.display_name AS display_name_of_service_name,
    gaa.owner_stem_id AS service_stem_id
   FROM public.grouper_attribute_def_name gadn,
    public.grouper_attribute_def gad,
    public.grouper_groups gg,
    public.grouper_memberships_all_v gmav,
    public.grouper_attribute_assign gaa,
    public.grouper_stem_set gss,
    public.grouper_members gm,
    public.grouper_fields gf
  WHERE (((gadn.attribute_def_id)::text = (gad.id)::text) AND ((gad.attribute_def_type)::text = 'service'::text) AND ((gaa.attribute_def_name_id)::text = (gadn.id)::text) AND ((gad.assign_to_stem)::text = 'T'::text) AND ((gmav.field_id)::text = (gf.id)::text) AND ((gmav.immediate_mship_enabled)::text = 'T'::text) AND ((gmav.owner_group_id)::text = (gg.id)::text) AND ((gaa.owner_stem_id)::text = (gss.then_has_stem_id)::text) AND ((gg.parent_stem)::text = (gss.if_has_stem_id)::text) AND ((gaa.enabled)::text = 'T'::text) AND ((gmav.member_id)::text = (gm.id)::text) AND ((gf.name)::text = ANY ((ARRAY['admins'::character varying, 'members'::character varying, 'readers'::character varying, 'updaters'::character varying])::text[])));


