--
-- Name: grouper_stems_v; Type: VIEW; Schema: public; Owner: de
--

CREATE VIEW public.grouper_stems_v AS
 SELECT gs.extension,
    gs.name,
    gs.display_extension,
    gs.display_name,
    gs.description,
    ( SELECT gs_parent.name
           FROM public.grouper_stems gs_parent
          WHERE ((gs_parent.id)::text = (gs.parent_stem)::text)) AS parent_stem_name,
    ( SELECT gs_parent.display_name
           FROM public.grouper_stems gs_parent
          WHERE ((gs_parent.id)::text = (gs.parent_stem)::text)) AS parent_stem_displayname,
    ( SELECT gm.subject_source
           FROM public.grouper_members gm
          WHERE ((gm.id)::text = (gs.creator_id)::text)) AS creator_source,
    ( SELECT gm.subject_id
           FROM public.grouper_members gm
          WHERE ((gm.id)::text = (gs.creator_id)::text)) AS creator_subject_id,
    ( SELECT gm.subject_source
           FROM public.grouper_members gm
          WHERE ((gm.id)::text = (gs.modifier_id)::text)) AS modifier_source,
    ( SELECT gm.subject_id
           FROM public.grouper_members gm
          WHERE ((gm.id)::text = (gs.modifier_id)::text)) AS modifier_subject_id,
    gs.create_time,
    gs.creator_id,
    gs.id AS stem_id,
    gs.modifier_id,
    gs.modify_time,
    gs.parent_stem,
    gs.hibernate_version_number,
    gs.context_id
   FROM public.grouper_stems gs;


